import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';
import CardItem from './CardItem';

function HeroSection() {
  return (
    <div className='hero-container'>

        <h1>Schönheitselixier Salon</h1>
        <p>By Alwina Schäfer</p>
          <ul className='cards__item-1'>
              <CardItem 
                src='images/AsLifeStyle-1_Page_02.jpg'
                text='
                Herzlich willkommen, mein Name ist Alwina Schäfer. Ich biete Ihnen anamnestische Behandlungen, Beratung, Empfehlungen, Tipps und Tricks'
                label='Geschäftsleitung'
                path='/'
              />
            </ul>
    </div>

  )
}

export default HeroSection
